import Item from './item.js';

class Body extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        const left = <div><div className={'main_left_number'}></div><div className={'main_left_detail'}></div></div>;
        const picture = <div className={'main_picture'}></div>;
        const detail = <div><div className={'main_picture_detail'}></div><div className={'main_picture_changebar'}></div>
        <div className={'main_picture_title'}></div></div>;
        const right = <div><div className={'main_next_picture'}></div></div>;

        const main = <div>{left}{picture}{detail}{right}</div>
        const items = <div></div>
        const div=<div></div>

        return(div);
    }
}

export default Body;
